
File References:
- Podfile
- Frameworks:
  - iOS:
    - Foundation.framework
- Pods:
  - Realm:
    - Frameworks:
      - Realm.framework
  - RealmSwift:
    - Aliases.swift
    - List.swift
    - Migration.swift
    - Object.swift
    - ObjectSchema.swift
    - Property.swift
    - Realm.swift
    - Results.swift
    - Schema.swift
    - SortDescriptor.swift
    - Util.swift
    - Support Files:
      - Info.plist
      - RealmSwift.modulemap
      - RealmSwift.xcconfig
      - RealmSwift-dummy.m
      - RealmSwift-prefix.pch
      - RealmSwift-umbrella.h
- Products:
  - Pods.framework
  - RealmSwift.framework
- Targets Support Files:
  - Pods:
    - Info.plist
    - Pods.modulemap
    - Pods-acknowledgements.markdown
    - Pods-acknowledgements.plist
    - Pods-dummy.m
    - Pods-frameworks.sh
    - Pods-resources.sh
    - Pods-umbrella.h
    - Pods.debug.xcconfig
    - Pods.release.xcconfig



Targets:
- Pods:
    Build Phases:
    - SourcesBuildPhase:
      - Pods-dummy.m
    - FrameworksBuildPhase:
      - Foundation.framework
    - HeadersBuildPhase:
      - Pods-umbrella.h:
          ATTRIBUTES:
          - Public
    Build Configurations:
    - Debug:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: iPhone Developer
          CURRENT_PROJECT_VERSION: '1'
          DEFINES_MODULE: 'YES'
          DYLIB_COMPATIBILITY_VERSION: '1'
          DYLIB_CURRENT_VERSION: '1'
          DYLIB_INSTALL_NAME_BASE: "@rpath"
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
          INFOPLIST_FILE: Target Support Files/Pods/Info.plist
          INSTALL_PATH: "$(LOCAL_LIBRARY_DIR)/Frameworks"
          IPHONEOS_DEPLOYMENT_TARGET: '8.0'
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks @loader_path/Frameworks"
          MACH_O_TYPE: staticlib
          MODULEMAP_FILE: Target Support Files/Pods/Pods.modulemap
          MTL_ENABLE_DEBUG_INFO: 'YES'
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PODS_ROOT: "$(SRCROOT)"
          PRODUCT_NAME: Pods
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          SWIFT_OPTIMIZATION_LEVEL: "-Onone"
          TARGETED_DEVICE_FAMILY: '1,2'
          VERSIONING_SYSTEM: apple-generic
          VERSION_INFO_PREFIX: ''
        Base Configuration: Pods.debug.xcconfig
    - Release:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: iPhone Developer
          CURRENT_PROJECT_VERSION: '1'
          DEFINES_MODULE: 'YES'
          DYLIB_COMPATIBILITY_VERSION: '1'
          DYLIB_CURRENT_VERSION: '1'
          DYLIB_INSTALL_NAME_BASE: "@rpath"
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
          INFOPLIST_FILE: Target Support Files/Pods/Info.plist
          INSTALL_PATH: "$(LOCAL_LIBRARY_DIR)/Frameworks"
          IPHONEOS_DEPLOYMENT_TARGET: '8.0'
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks @loader_path/Frameworks"
          MACH_O_TYPE: staticlib
          MODULEMAP_FILE: Target Support Files/Pods/Pods.modulemap
          MTL_ENABLE_DEBUG_INFO: 'NO'
          OTHER_LDFLAGS: ''
          OTHER_LIBTOOLFLAGS: ''
          PODS_ROOT: "$(SRCROOT)"
          PRODUCT_NAME: Pods
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
          VERSIONING_SYSTEM: apple-generic
          VERSION_INFO_PREFIX: ''
        Base Configuration: Pods.release.xcconfig
- RealmSwift:
    Build Phases:
    - SourcesBuildPhase:
      - Aliases.swift
      - List.swift
      - Migration.swift
      - Object.swift
      - ObjectSchema.swift
      - Property.swift
      - Realm.swift
      - RealmSwift-dummy.m
      - Results.swift
      - Schema.swift
      - SortDescriptor.swift
      - Util.swift
    - FrameworksBuildPhase:
      - Foundation.framework
    - HeadersBuildPhase:
      - RealmSwift-umbrella.h:
          ATTRIBUTES:
          - Public
    Build Configurations:
    - Debug:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: iPhone Developer
          CURRENT_PROJECT_VERSION: '1'
          DEFINES_MODULE: 'YES'
          DYLIB_COMPATIBILITY_VERSION: '1'
          DYLIB_CURRENT_VERSION: '1'
          DYLIB_INSTALL_NAME_BASE: "@rpath"
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
          GCC_PREFIX_HEADER: Target Support Files/RealmSwift/RealmSwift-prefix.pch
          INFOPLIST_FILE: Target Support Files/RealmSwift/Info.plist
          INSTALL_PATH: "$(LOCAL_LIBRARY_DIR)/Frameworks"
          IPHONEOS_DEPLOYMENT_TARGET: '8.0'
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks @loader_path/Frameworks"
          MODULEMAP_FILE: Target Support Files/RealmSwift/RealmSwift.modulemap
          MTL_ENABLE_DEBUG_INFO: 'YES'
          PRODUCT_NAME: RealmSwift
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          SWIFT_OPTIMIZATION_LEVEL: "-Onone"
          TARGETED_DEVICE_FAMILY: '1,2'
          VERSIONING_SYSTEM: apple-generic
          VERSION_INFO_PREFIX: ''
        Base Configuration: RealmSwift.xcconfig
    - Release:
        Build Settings:
          ARCHS: "$(ARCHS_STANDARD_64_BIT)"
          CODE_SIGN_IDENTITY[sdk=iphoneos*]: iPhone Developer
          CURRENT_PROJECT_VERSION: '1'
          DEFINES_MODULE: 'YES'
          DYLIB_COMPATIBILITY_VERSION: '1'
          DYLIB_CURRENT_VERSION: '1'
          DYLIB_INSTALL_NAME_BASE: "@rpath"
          ENABLE_STRICT_OBJC_MSGSEND: 'YES'
          GCC_PREFIX_HEADER: Target Support Files/RealmSwift/RealmSwift-prefix.pch
          INFOPLIST_FILE: Target Support Files/RealmSwift/Info.plist
          INSTALL_PATH: "$(LOCAL_LIBRARY_DIR)/Frameworks"
          IPHONEOS_DEPLOYMENT_TARGET: '8.0'
          LD_RUNPATH_SEARCH_PATHS: "$(inherited) @executable_path/Frameworks @loader_path/Frameworks"
          MODULEMAP_FILE: Target Support Files/RealmSwift/RealmSwift.modulemap
          MTL_ENABLE_DEBUG_INFO: 'NO'
          PRODUCT_NAME: RealmSwift
          SDKROOT: iphoneos
          SKIP_INSTALL: 'YES'
          TARGETED_DEVICE_FAMILY: '1,2'
          VERSIONING_SYSTEM: apple-generic
          VERSION_INFO_PREFIX: ''
        Base Configuration: RealmSwift.xcconfig



Build Configurations:
- Debug:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_CXX_LANGUAGE_STANDARD: gnu++0x
      CLANG_CXX_LIBRARY: libc++
      CLANG_ENABLE_MODULES: 'YES'
      CLANG_ENABLE_OBJC_ARC: 'YES'
      CLANG_WARN_BOOL_CONVERSION: 'YES'
      CLANG_WARN_CONSTANT_CONVERSION: 'YES'
      CLANG_WARN_DIRECT_OBJC_ISA_USAGE: 'YES'
      CLANG_WARN_EMPTY_BODY: 'YES'
      CLANG_WARN_ENUM_CONVERSION: 'YES'
      CLANG_WARN_INT_CONVERSION: 'YES'
      CLANG_WARN_OBJC_ROOT_CLASS: 'YES'
      CLANG_WARN_UNREACHABLE_CODE: 'YES'
      CLANG_WARN__DUPLICATE_METHOD_MATCH: 'YES'
      COPY_PHASE_STRIP: 'NO'
      GCC_C_LANGUAGE_STANDARD: gnu99
      GCC_DYNAMIC_NO_PIC: 'NO'
      GCC_OPTIMIZATION_LEVEL: '0'
      GCC_PREPROCESSOR_DEFINITIONS:
      - DEBUG=1
      - "$(inherited)"
      GCC_SYMBOLS_PRIVATE_EXTERN: 'NO'
      GCC_WARN_64_TO_32_BIT_CONVERSION: 'YES'
      GCC_WARN_ABOUT_RETURN_TYPE: 'YES'
      GCC_WARN_UNDECLARED_SELECTOR: 'YES'
      GCC_WARN_UNINITIALIZED_AUTOS: 'YES'
      GCC_WARN_UNUSED_FUNCTION: 'YES'
      GCC_WARN_UNUSED_VARIABLE: 'YES'
      IPHONEOS_DEPLOYMENT_TARGET: '8.0'
      ONLY_ACTIVE_ARCH: 'YES'
      STRIP_INSTALLED_PRODUCT: 'NO'
      SYMROOT: "${SRCROOT}/../build"
- Release:
    Build Settings:
      ALWAYS_SEARCH_USER_PATHS: 'NO'
      CLANG_CXX_LANGUAGE_STANDARD: gnu++0x
      CLANG_CXX_LIBRARY: libc++
      CLANG_ENABLE_MODULES: 'YES'
      CLANG_ENABLE_OBJC_ARC: 'YES'
      CLANG_WARN_BOOL_CONVERSION: 'YES'
      CLANG_WARN_CONSTANT_CONVERSION: 'YES'
      CLANG_WARN_DIRECT_OBJC_ISA_USAGE: 'YES'
      CLANG_WARN_EMPTY_BODY: 'YES'
      CLANG_WARN_ENUM_CONVERSION: 'YES'
      CLANG_WARN_INT_CONVERSION: 'YES'
      CLANG_WARN_OBJC_ROOT_CLASS: 'YES'
      CLANG_WARN_UNREACHABLE_CODE: 'YES'
      CLANG_WARN__DUPLICATE_METHOD_MATCH: 'YES'
      COPY_PHASE_STRIP: 'YES'
      ENABLE_NS_ASSERTIONS: 'NO'
      GCC_C_LANGUAGE_STANDARD: gnu99
      GCC_PREPROCESSOR_DEFINITIONS: RELEASE=1
      GCC_WARN_64_TO_32_BIT_CONVERSION: 'YES'
      GCC_WARN_ABOUT_RETURN_TYPE: 'YES'
      GCC_WARN_UNDECLARED_SELECTOR: 'YES'
      GCC_WARN_UNINITIALIZED_AUTOS: 'YES'
      GCC_WARN_UNUSED_FUNCTION: 'YES'
      GCC_WARN_UNUSED_VARIABLE: 'YES'
      IPHONEOS_DEPLOYMENT_TARGET: '8.0'
      STRIP_INSTALLED_PRODUCT: 'NO'
      SYMROOT: "${SRCROOT}/../build"
      VALIDATE_PRODUCT: 'YES'
